import React from 'react'
import './ContactCard.css'

const ContactCard = ({text}) => {
  return (
    <div className='contact-details-card'>
      <div className='bi bi-envelope'></div>
      <div className='bi bi-github'>

        
      </div>
      <p>{text}</p>
    </div>
  )
}

export default ContactCard
